def min_moves_to_digit_sum(n: int, s: int) -> int:

    def digit_sum(num: int) -> int:
        res = 0
        while num > 0:
            res += num % 10
            num //= 10
        return res

    def digit_length(num: int) -> int:
        res = 0
        while num > 0:
            res += 1
            num //= 10
        return res
    if digit_sum(n) < s:
        return 0
    len_n = digit_length(n)
    ans = 10 ** 20
    for i in range(len_n):
        p = n // 10 ** (i + 1)
        p = p * 10 ** (i + 1)
        p += 10 ** (i + 1)
        if digit_sum(p) <= s:
            ans = min(ans, p - n)
    return ans

